script: |
  super -f text -I q341.spq | sort > q341.out

inputs:
  - name: q341.spq
    data: |
      SELECT col2 AS col0 FROM tab2 (FORMAT parquet) WHERE NOT - col0 / + - 55 * 64 - col1 * - col1 + + - col2 * + col1 + - col1 - col2 - - 93 * - 52 NOT IN ( - 84 + - + col1 );
  - name: tab2

outputs:
  - name: q341.out
    data: |
